import React from "react";

import item5 from "../img/item-5.png";
import item6 from "../img/item-6.png";
import item7 from "../img/item-7.png";

import TheItem from "./TheItem";
const itemPIC = [item1, item2, item3, item4, item5, item6, item7, item8, item9];
const MightLike = (props) => {
  return (
    <section className="items">
      <div className="container">
        <TheItem title={props.items[5].name} pic={props.items[5].image} />
        <TheItem title={props.items[6].name} pic={props.items[6].image} />
        <TheItem title={props.items[7].name} pic={props.items[7].image} />
      </div>
      <button>MORE PRODUCTS</button>
    </section>
  );
};

export default MightLike;
